px; text-align: center; color: rgb(132, 132, 132);">不同之处，一目了然。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 14px; line-height: 25px; text-indent: 28px;">配备 Retina 显示屏的 iPad mini 不仅拿在手上时令人惊叹，看在眼里时更会沉浸其中。每张照片都难以置信的细致生动，每行文字都超乎寻常的明锐清晰。凭借更胜 HDTV 的超高分辨率，iPad mini 的绚丽夺目，自此提升至全新境界。</p><p style="text-align: center;"><img src="http://www.1ykxm.com/statics/uploads/shopimg/20140412/36614398295310.jpg" title="20131024104701179.jpg"/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src="http://www.1ykxm.com/statics/uploads/shopimg/20140412/91459942295350.jpg" title="20131024104719384.jpg"/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src="http://www.1ykxm.com/statics/uploads/shopimg/20140412/26544600295350.jpg" title="20131024104713336 (1).jpg"/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src="http://www.1ykxm.com/statics/uploads/shopimg/20140412/32634542295350.jpg" title="20131024104713336.jpg"/></p><p><br/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 30px; line-height: 35px; text-align: center;">A7芯片</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 24px; line-height: 30px; text-align: center; color: rgb(132, 132, 132);">台式电脑级架构，但不限于台面。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 14px; line-height: 25px; text-indent: 28px;">别被其大小所迷惑，采用 64 位架构的全新 A7 芯片，赋予 iPad mini 远超以往的强大。A7 芯片造就的卓越性能，使 iPad mini 的处理器速度和图形处理速度，分别比上一代芯片快达 4 倍和 8 倍，但电池使用时间却丝毫未减。因此，现在你可以让一种超乎寻常的强大力量，与你随身而行。</p><p style="text-align: center;"><img src="http://www.1ykxm.com/statics/uploads/shopimg/20140412/44009304295481.jpg" title="20131024104726395.jpg"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 30px; line-height: 35px; text-align: center;">一系列强大 App</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 24px; line-height: 30px; text-align: center; color: rgb(132, 132, 132);">工作娱乐，一切就绪。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 14px; line-height: 25px; text-indent: 28px;">iPad 的 app 截然与众不同。因为它们只为 iPad 量身设计，所以看起来如此惊艳夺目，显示屏上每一颗像素的绚丽色彩，于此都有淋漓尽致的发挥。iPad mini 内置多款出色 app 来处理你的日常事务，比如查看电子邮件和浏览网络。为了帮助你尽情挥洒创意和提高工作效率，iPhoto、iMovie、GarageBand、Pages、Numbers 和 Keynote 现已为每台新购买的 iPad mini 准备就绪。不仅如此，在 App Store 中更有超过 475,000 款精彩 iPad app 触手可及2。正是有了如此出色的一系列 app，iPad mini 几乎无所不能，这意味着你也同样如此。</p><p style="text-align: center;"><img src="http://www.1ykxm.com/statics/uploads/shopimg/20140412/49462009295523.jpg" title="20131024104800954.jpg"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 30px; line-height: 35px; text-align: center;">先进的无线网络连接</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 10px; font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 24px; line-height: 30px; text-align: center; color: rgb(132, 132, 132);">更多地方，更大作为。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; color: rgb(51, 51, 51); font-family: 微软雅黑; white-space: normal; background-color: rgb(255, 255, 255); font-size: 14px; line-height: 25px; text-indent: 28px;">iPad mini 让你的网络连接速度远超以往，适用地点大大扩展。通过用两条天线取代一条天线，以及配备 MIMO 技术，iPad mini 拥有比上代产品快达 2 倍的无线连接速度。不仅如此，WLAN + Cellular 机型还支持世界各地更多网络。所以环顾世界，尽有能让你轻松快速享受网络的地方。</p><p><span style="color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;苹果（Apple）iPad mini Retina 平板电脑 16G WiFi版（预售） 1元开心购将在到货后第一时间按订单顺序发出，颜色随机发出。</span></p><p><span style="color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);"><br/></span></p><p><span style="color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 12px; line-height: 18px; background-color: rgb(255, 255, 255);"><br/></span></p>\',\'0\',\'0\', \'1\',\'1397295584\')',
